description:
First demo offered by these new &quot;Old School Death Metal&quot; mavens from Belgium! It clocks in at a little over 15 minutes.

MP3 (320 kbps)

Tracks include:

&quot;Intro - (Evil Aeternum)&quot;

&quot;Born Demonic&quot;

&quot;Hyper-Kill Transformation&quot;

&quot;Subterranean Nightmare&quot;

&quot;The Devious Grotesque&quot;

&quot;Outro - (Purified in Filth)&quot;

Also, there's an MP3 of &quot;Subterranean Nightmare (Full Demo)&quot; (purportedly for the &quot;nostalgia&quot; of &quot;tape trading&quot; back in the day. Plus each song flows into the next without the annoying MP3 &quot;pause&quot; between tracks - a constant headbanging tour de force, instead!).
